import React from "react";

function DataTable({ users }) {
  return (
    <div>
      <thead>
        <tr>
          <th>Employee</th>
          <th>First Name</th>
          <th>Last Name</th>
          <th>Email</th>
        </tr>
      </thead>

    </div>
  );
}

export default DataTable;
